import React from "react"
import { MapContainer as LeafletMap, TileLayer, Circle} from "react-leaflet"
import {showDataOnMap} from "./util.js"
import ChangeView from "./ChangeView.js"
import "./Map.css"

function Map(props) {

  return (
    <div className="map">
      {console.log(props.countries[206]?.cases)}
      <LeafletMap center={props.center} zoom={props.zoom}>
        <ChangeView center={props.center} zoom={props.zoom} />
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        />
        {props.countries.map(country => (
          <Circle center={[countryInfo.lat, countryInfo.long]} radius={400} />
        ))}
      </LeafletMap>
    </div>
  )
}

export default Map

